import React from "react";

function AGEBInfo({ ageb }) {
  if (!ageb || !ageb.properties) {
    return <div>No neighborhood information available.</div>;
  }

  const properties = ageb.properties;

  return (
    <div className="ageb-info">
      <h2>Neighborhood Information</h2>
      <p>CVEGEO: {properties.CVEGEO}</p>
      <p>CVE_ENT: {properties.CVE_ENT}</p>
      <p>CVE_MUN: {properties.CVE_MUN}</p>
      <p>CVE_AGEB: {properties.CVE_AGEB}</p>
      {/* Add more neighborhood information as needed */}
    </div>
  );
}

export default AGEBInfo;
